#!/bin/sh

######################################################################
# Verify that the consensus binary being tested produces the 
# same *.cgi file that an earlier known good version of consensus
# produced. Verification is made by comparing the md5 of the 
# generated *.cgi file with the known good md5.
#
# Consensus Invocation
# --------------------
# consensus -P -U baseline.frgStore baseline.cgb
######################################################################

. ../testconf

###
# Name by which this script was invoked.
###
progname=`echo "$0" | sed -e 's/[^\/]*\///g'`

usage="Usage: $progname <consensus binary>

<consensus>            Path to consensus binary to test
"

###
# Tests should always be run from the directory
# in which the script exists
###
CWD=$(pwd)

PROGFILE=$(basename $progname)
PROGPRFX=${PROGFILE%%.sh}

RUN_DIR=${PROGPRFX}_run
TMP_DIR=${PROGPRFX}_tmp

FRAG_PREF=baseline
FRAG_STORE_DIR=${FRAG_PREF}.frgStore
FRAG_CGB=${FRAG_PREF}.cgb

TEST_MD5=${CWD}/${TMP_DIR}/test_md5sum.$$
GOOD_MD5=${CWD}/${TMP_DIR}/good_md5sum.$$

CNS_BIN=""

CHECK_UTILS() {
  $(which $MD5_BIN > /dev/null 2>&1) || {
    echo "Err: $MD5_BIN binary not found"
    exit 1
  }
}

PASSED() {
  echo "-----------------------------"; 
  echo "*** SUCCESS - Passed Test ***"; 
  echo "-----------------------------"; echo ""
  exit 0
}

FAILED() {
  echo "-----------------------------"; 
  echo "*** FAILURE - Failed Test ***"; 
  echo "-----------------------------"; echo ""
  exit 1
}

CLEANUP() {
  pushd ${RUN_DIR} > /dev/null 2>&1
  rm -rf $FRAG_STORE_DIR
  rm -f  ${FRAG_PREF}.*
  rm -f  $TEST_MD5
  rm -f  $GOOD_MD5
  echo
  popd > /dev/null 2>&1

  rmdir $RUN_DIR
  rmdir $TMP_DIR
}


CHECK_UTILS() {
  $(which $MD5_BIN > /dev/null 2>&1) || {
    echo "Err: $MD5_BIN binary not found"
    exit 1
  }
}

INIT() {
  rm -rf $RUN_DIR
  mkdir $RUN_DIR

  rm -rf $TMP_DIR
  mkdir $TMP_DIR

  create_cgb_file
  create_fragStore_files
}

#####
# Function
#   gen_good_md5
#
# Purpose
#   Create the file containing our baseline MD5 
#   checksums of the consensus *.cgi file 
#   generated from a baseline run of consensus
# 
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - NONE
#####
gen_good_md5() {
  cat > $GOOD_MD5 << EOF
9ce4d4f2a71310b25f8bfe5e4f5def5a  baseline.cgi
EOF
}

#####
# Function
#   gen_test_md5
#
# Purpose
#   Generate MD5 sums of consensus created *.cgi
#   file by running 'md5sum' against the file 
# 
# Arguments
#   file - *.cgi file  
#         
# Return
#   success - NONE
#   failure - exit 1
#####
gen_test_md5()
{
  local file=$1

  if [ ! -f $file ]; then
    echo "gen_test_md5: directory $dir does not exist";
    exit 1;
  fi

  md5sum $file > $TEST_MD5
}

#####
# Function
#   clean_cgi_file
#
# Purpose
#   Remove things like the $Id: tag which show up in the
#   generated *.cgi file and which may throw off the md5
#   sum
#
# Arguments
#   file - *.cgi file to clean up
#
# Return
#   success - NONE
#   failure - exit 1
#####
clean_cgi_file() 
{
  local file=$1
  local tmpf=/tmp/.cgi.$$

  cat $file | awk '
    BEGIN {
      stack = 0;
      state = "NONE";
    }

    {
      if (state == "NONE") {
        if (/^{ADL/) {
          state = "INADL";
          stack++;
        }
      }

      if (state == "INADL") {
        if (/^who:/) {
          print "who:";
          next;
        }
        if (/^ctm:/) {
          print "ctm:";
          next;
        }
        if (/^com:/) {
          print "com:";
          state = "INADL_COM";
        }
      }
 
      if (state == "INADL_COM") 
        if (/^\./)
          state = "INADL";

      if (state != "INADL_COM")
        print $0

      if (state == "INADL") {
        if (/^}/) {
          state = "NONE";
          stack--;

          if (stack != 0) {
            print NR"\t"$0;
            exit 1;
          }
        }
      }
    }
  ' > $tmpf

  mv $tmpf $file
}

#####
# Function
#   RUN_TEST
#
# Purpose
#   Run the given consensus binary against the 
#   fragStore/ files and cgb file within this script. 
#   Verify that the results match the baseline results 
#   by comparing MD5 checksums of the generated 
#   gatekeeper store files
#
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - exit 1
#####
RUN_TEST() {
  if [ ! -f $CNS_BIN ]; then
    echo "Err: $(pwd)/consensus executable not found"
    FAILED
  fi

  if [ ! -d ${RUN_DIR}/$FRAG_STORE_DIR ]; then
    echo "Err: $(pwd)/${RUN_DIR}/$FRAG_STORE_DIR directory not found"
    FAILED
  fi

  if [ ! -f ${RUN_DIR}/$FRAG_CGB ]; then
    echo "Err: $(pwd)/${RUN_DIR}/$FRAG_CGB file not found"
    FAILED
  fi

  pushd ${RUN_DIR} > /dev/null 2>&1

  ###
  # Clean up from any previous runs
  ###
  rm -f ${FRAG_PREF}.cgi
  rm -f ${FRAG_PREF}.cgi.clg

  ###
  # Run consensus against the frag file contained
  # within this script
  ###
  $CNS_BIN -P -U ${FRAG_STORE_DIR} ${FRAG_CGB} > /dev/null 2>&1
  ret=$?

  if [ "$ret" -ne "0" ]; then
    echo "cns_exec: $(pwd)/consensus failed!"
    FAILED
  fi

  if [ ! -f ${FRAG_PREF}.cgi ]; then
    echo "cns_exec: consensus *.cgi file NOT created"
    FAILED
  fi

  clean_cgi_file ${FRAG_PREF}.cgi

  ###
  # Generate the MD5 of the consensus *.cgi
  # file we just created
  #
  # Then create the MD5s of the known good (baseline)
  # consensus *.cgi file
  ###
  gen_test_md5 ${FRAG_PREF}.cgi
  gen_good_md5

  ###
  # They should be the same since we are running
  # consensus against the same input used to 
  # generate the baseline MD5s
  ###
#  diff -q $TEST_MD5 $GOOD_MD5 > /dev/null
  diff $TEST_MD5 $GOOD_MD5 
  ret=$?

  if [ "$ret" -ne "0" ]; then
    ###
    # They were not the same! If the output *should*
    # be different the known good MD5s should be
    # updated!
    ###
    FAILED
  fi

  popd > /dev/null 2>&1
}

